import { Button } from "react-bootstrap";


export const CartItem = (props) => {
    const { title, price, productImg} = props.data;
    return (
        <div className="cart-item">
        <img src={productImg} height="200px" alt="product" />
            <div className="description">
                <p>
                    { " " } 
                    <b>{title}</b>
                </p>
                <p>NOK {price},-</p>
            </div>
            <Button>+</Button>
            <Button>-</Button>

        </div>
    )
}
